Tasha Reign - Anglin' For A Banglin'
Added: October 09, 2010

&quot;Tasha is a pro angler. When signing in to the fishing tournament at the tackle shop, Tasha is hit on by the reigning champion, and local redneck Jordan. By chance the two get paired up head-to-head and when Tasha hooks the 'big one' but can't land it, Jordan is there to help her out. The two return to the tackle shop where Jordan gives her a personal lesson on how to handle a rod.&quot;
